<html lang="en">
<head>

    <style>
        * { box-sizing: border-box; margin: 0; padding: 0; }
        body { 
            font-family: 'Segoe UI', system-ui, sans-serif; 
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            padding: 20px;
        }
        .container { max-width: 1400px; margin: 0 auto; }
        .header { 
            background: rgba(255,255,255,0.95); 
            padding: 30px; 
            border-radius: 16px; 
            text-align: center;
            margin-bottom: 20px;
            box-shadow: 0 10px 40px rgba(0,0,0,0.2);
        }
        .header h1 { 
            font-size: 2.5em; 
            background: linear-gradient(135deg, #667eea, #764ba2);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            margin-bottom: 10px;
        }
        .header p { color: #666; font-size: 1.1em; }
        .section { 
            background: rgba(255,255,255,0.95); 
            border-radius: 16px; 
            padding: 25px;
            margin-bottom: 20px;
            box-shadow: 0 10px 40px rgba(0,0,0,0.15);
        }
        .section-title { 
            font-size: 1.5em; 
            color: #333; 
            margin-bottom: 20px;
            padding-bottom: 15px;
            border-bottom: 3px solid #667eea;
            display: flex;
            align-items: center;
            gap: 10px;
        }
        .container-viz { height: 500px; }
        .bundle-grid { 
            display: grid; 
            grid-template-columns: repeat(auto-fill, minmax(300px, 1fr)); 
            gap: 15px; 
        }
        .bundle-card { 
            background: #f8f9fa; 
            border-radius: 12px; 
            overflow: hidden;
            transition: all 0.3s ease;
            border: 1px solid #e0e0e0;
            cursor: pointer;
        }
        .bundle-card:hover { 
            transform: translateY(-3px); 
            box-shadow: 0 10px 25px rgba(0,0,0,0.1);
            border-color: #667eea;
        }
        .bundle-card.active {
            border: 2px solid #667eea;
            box-shadow: 0 10px 25px rgba(102,126,234,0.3);
        }
        .bundle-header { 
            background: linear-gradient(135deg, #667eea, #764ba2);
            color: white;
            padding: 12px 15px;
            font-weight: 600;
            display: flex;
            justify-content: space-between;
            align-items: center;
        }
        .bundle-header .type { 
            background: rgba(255,255,255,0.2);
            padding: 3px 10px;
            border-radius: 20px;
            font-size: 0.8em;
        }
        .bundle-stats {
            display: flex;
            gap: 15px;
            padding: 12px 15px;
            background: #fff;
            font-size: 0.85em;
            flex-wrap: wrap;
        }
        .stat { 
            display: flex;
            align-items: center;
            gap: 5px;
        }
        .stat-value { font-weight: 600; color: #667eea; }
        .bundle-viewer {
            background: #f8f9fa;
            border-radius: 12px;
            padding: 20px;
            margin-top: 20px;
            min-height: 450px;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        .bundle-viewer-placeholder {
            text-align: center;
            color: #999;
        }
        .bundle-viewer-placeholder .icon { font-size: 4em; margin-bottom: 10px; }
        #bundle-detail-viz { width: 100%; height: 400px; }
        .tabs {
            display: flex;
            gap: 10px;
            margin-bottom: 20px;
            flex-wrap: wrap;
        }
        .tab {
            padding: 10px 20px;
            background: #e0e0e0;
            border: none;
            border-radius: 25px;
            cursor: pointer;
            font-size: 0.95em;
            transition: all 0.3s ease;
        }
        .tab.active {
            background: linear-gradient(135deg, #667eea, #764ba2);
            color: white;
        }
        .tab:hover:not(.active) { background: #ccc; }
        .summary-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(150px, 1fr));
            gap: 15px;
            margin-top: 20px;
        }
        .summary-card {
            background: linear-gradient(135deg, #667eea, #764ba2);
            color: white;
            padding: 20px;
            border-radius: 12px;
            text-align: center;
        }
        .summary-card .value { font-size: 1.8em; font-weight: 700; }
        .summary-card .label { opacity: 0.9; margin-top: 5px; font-size: 0.9em; }
        .bundle-detail-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 15px;
        }
        .close-btn {
            background: #e74c3c;
            color: white;
            border: none;
            padding: 8px 15px;
            border-radius: 20px;
            cursor: pointer;
            font-size: 0.9em;
        }
        .close-btn:hover { background: #c0392b; }
    </style>

        let currentBundleId = null;
        
        // Render container
        Plotly.newPlot('container-viz', containerData.data, {
            ...containerData.layout,
            title: 'Container Overview - Drag to rotate, scroll to zoom',
            height: 500,
            margin: {l:0, r:0, t:40, b:0}
        }, {responsive: true});
        
        // Render bundle cards (without 3D - lazy load on click)
        function renderBundleCards(filter = 'all') {
            const grid = document.getElementById('bundle-grid');
            grid.innerHTML = '';
            
            bundleData.forEach((bundle) => {
                if (filter !== 'all' && bundle.type !== filter) return;
                
                const card = document.createElement('div');
                card.className = 'bundle-card' + (bundle.id === currentBundleId ? ' active' : '');
                card.dataset.id = bundle.id;
                card.innerHTML = `
                    <div class="bundle-header">
                        <span>Bundle #${bundle.id}</span>
                        <span class="type">${bundle.type}</span>
                    </div>
                    <div class="bundle-stats">
                        <div class="stat">ðŸ“¦ <span class="stat-value">${bundle.items}</span> items</div>
                        <div class="stat">ðŸ“ <span class="stat-value">${bundle.size}</span></div>
                        <div class="stat">ðŸ“Š <span class="stat-value">${bundle.fill_rate}</span></div>
                    </div>
                `;
                card.onclick = () => showBundleDetail(bundle.id);
                grid.appendChild(card);
            });
        }
        
        // Show bundle 3D detail (lazy load)
        function showBundleDetail(bundleId) {
            const bundle = bundleData.find(b => b.id === bundleId);
            if (!bundle) return;
            
            currentBundleId = bundleId;
            
            // Update active state on cards
            document.querySelectorAll('.bundle-card').forEach(c => {
                c.classList.toggle('active', parseInt(c.dataset.id) === bundleId);
            });
            
            const viewer = document.getElementById('bundle-viewer');
            viewer.innerHTML = `
                <div style="width: 100%;">
                    <div class="bundle-detail-header">
                        <h3>Bundle #${bundle.id} - ${bundle.type} (${bundle.items} items, ${bundle.fill_rate} fill)</h3>
                        <button class="close-btn" onclick="closeBundleDetail()">âœ• Close</button>
                    </div>
                    <div id="bundle-detail-viz"></div>
                </div>
            `;
            
            // Render the 3D plot
            const figData = JSON.parse(bundle.fig_json);
            Plotly.newPlot('bundle-detail-viz', figData.data, {
                ...figData.layout,
                height: 400,
                margin: {l:0, r:0, t:10, b:0}
            }, {responsive: true});
        }
        
        function closeBundleDetail() {
            currentBundleId = null;
            document.querySelectorAll('.bundle-card').forEach(c => c.classList.remove('active'));
            
            const viewer = document.getElementById('bundle-viewer');
            // Cleanup WebGL context
            Plotly.purge('bundle-detail-viz');
            
            viewer.innerHTML = `
                <div class="bundle-viewer-placeholder">
                    <div class="icon">ðŸ‘†</div>
                    <p>Click on a bundle card below to view its 3D visualization</p>
                </div>
            `;
        }
        
        function filterBundles(type) {
            document.querySelectorAll('.tab').forEach(t => t.classList.remove('active'));
            event.target.classList.add('active');
            renderBundleCards(type);
        }
        
        // Initial render
        renderBundleCards();
    </script>
